import React from "react";

export const BASE_URL = 'http://localhost:3000';

export const request = (url, options) => {
  return fetch (`${BASE_URL}${url}`, options)
    .then(res => {
      if (!res.ok) {
        throw new Error('Error');
      }
      return res.json();
    })
};

export const getComments = () => {    //[{}, {}]
  return request(`/comments?_embed=replies`);
};

export const getRepliesByCommentId = (commentId) => {    //[{}, {}]
  return request(`/comments/${commentId}/replies`);
};

export const newComment = (data) => {
  return request(`/comments`, {
    method: 'POST',
    headers: {
      "Content-type": "application/json; charset=UTF-8"
    },
    body: JSON.stringify({
      id: Math.random(),
      name: 'Terry Bator',
      body: JSON.stringify(data),
      date: new Date(),
      avatar: "data:image/png;base64,",
      replies: [],
    })
  });
}

export const newReply = (commentId, data) => {
  return request(`/comments/${commentId}/replies`, {
    method: 'POST',
    headers: {
      "Content-type": "application/json; charset=UTF-8"
    },
    body: JSON.stringify({
      id: Math.random(),
      commentId: `${Number(commentId)}`,
      name: 'Terry Bator',
      body: data,
      date: Date.now(),
      avatar: "data:image/png;base64,",
    })
  });
}

export const DeleteComment = (commentId) => {
  return request(`/comments/${commentId}`, {
    method: 'DELETE',
  });
}

export const editComment = (commentId, data) => {
  return request(`/comments/${commentId}`, {
    method: 'PUT',
    headers: {
      "Content-type": "application/json; charset=UTF-8"
    },
    body: JSON.stringify({
      id: `${commentId}`,
      name: 'Terry Bator',
      body: JSON.stringify(data),
      date: new Date(),
      avatar: "data:image/png;base64,",
    })
  });
}
